import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {
        id:1,
        name: 'Event 1',
    },
    {
        id: 2,
        name: 'Event 2'
    }
];

const EventsPage = () => {
    return (
        // <h1>EventsPage</h1>
        <ul>
            {DUMMY_EVENTS.map(event => 
                <li>
                    <Link to={event.id}>{event.name}</Link>
                </li>
            )}
        </ul>
    );
}

export default EventsPage;
